import React from "react";
import { Nav, NavLink, NavMenu } 
    from "./NavbarElements";
import './index.css';
  
const Navbar = () => {
  return (
    <>
      <Nav>
        <NavMenu>
          <div><a href="#" class="navbar-brand">
      <img src="Photo/OIP (1).jpg" width="45" height="60px" alt="" class="d-inline-block align-left mr-2"/>
      <span class="text-uppercase font-weight-bold"> CITY HOSPITAL GWALIOR </span>
    </a>
    <button type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation" class="navbar-toggler"><span class="navbar-toggler-icon"></span></button>
</div>
          <NavLink to="/Home" activeStyle>
            Home 
          </NavLink>
          <NavLink to="/contact" activeStyle>
            Contact Us
          </NavLink>
          <NavLink to="/Login" activeStyle>
            Login
          </NavLink>
          <NavLink to="/Appointment" activeStyle>
            Appointment
          </NavLink>
        
        </NavMenu>
      </Nav>
    
    </>
  );
};
  
export default Navbar;
